// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "remix_tests.sol"; 
import "../contracts/UserRegistration.sol"; 

contract UserRegistrationTest {
    UserRegistration userRegistration;
    function beforeEach() public {
        userRegistration = new UserRegistration(); 
    }

    function testRegisterUser() public {
        userRegistration.register(); // Регистрация пользователя
        Assert.equal(userRegistration.isActive(address(this)), true, "User should be active after registration");
    }    
    
}

contracts/UserRegistration.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity  ^0.8.0;

contract UserRegistration {
    struct User {
        bool isRegistered;
        bool isActive;
    }

    mapping(address => User) private users;

    function register() public {
        require(!users[msg.sender].isRegistered, "User is already registered");
        
        users[msg.sender].isRegistered = true;
        users[msg.sender].isActive = true; 
    }
event DebugAddress(address user, string message);
    function isActive(address user) public view returns (bool) {
        return users[user].isActive;
    }
}

